    objects.add(Tglobal(
      txt_id: 'x000tg2501',
      text:
          'Сквайр в пылу битвы имеет обыкновение предлагать благородно поддержку посильную своим более слабым компаньонам, его оружие - сверкающий меч.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2502',
      text:
          'Рыцарь обязан использовать свою священную мощь лишь во имя справедливости в границах Империи и за пределами ее.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2503',
      text:
          'Абсолютная вера Рыцаря Империи предписывает тому защищать невиновных и зло карать нещадно, Имперский Рыцарь весьма серьезный противник.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2504',
      text:
          'Охотник на ведьм, во многих битвах с Силами Зла закаленный, презирает атаки врага, на силе Разума построенные.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2505',
      text:
          'Посвятивший себя зла искоренению, Инквизитор пользуется Силой Святой аки оружием и презирает атаки врага, на силе Разума построенные.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2506',
      text:
          'Атака лучника быстра и неотразима. Лучник - оружие мощное против магов злокозненных, за спинами сильных воинов подло скрывающихся.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2507',
      text:
          'Рейнджер есть воин умелый с луком, его стрелы летят дальше, и даже одна стрела способна смерть принести неприятелю.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2508',
      text:
          'Ученик наделен силою обрушивать молнии на головы воинов вражеских, от того он любит нападать с некоторого расстояния.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2509',
      text:
          'Множество магических тайн постигший, Волшебник поражает супостата молнией небесной, с руки его сходящей.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2510',
      text:
          'Обретя знания тайные, Маг не имеет равных себе в искусстве магическом, а молнии его способны испепелить любого врага.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2511',
      text:
          'Будучи начинающим лекарем, Послушница всегда готова облегчить страдания раненного воина, дабы он мог дальше сражаться с нечистью.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2512',
      text:
          'Жрец посвятил всю свою жизнь служению Добру, поэтому он заботливо ухаживает за раненым, совершая чудеса исцеления прямо на поле боя.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2513',
      text:
          'Священник наделен даром врачевания; под его присмотром к раненому возвращается большая часть жизненных сил.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2515',
      text:
          'Защитник веры, одетый в доспехи, самоотверженно сражается против нечестивцев, оскорбляющих имя Всевышнего.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2514',
      text:
          'Ангел, как посланник Всевышнего, всегда встает на защиту интересов Империи, и лишь тот, чья вера во Всевышнего непоколебима, способен выстоять при встрече с ангелом.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2516',
      text:
          'Несмотря на небольшой опыт во врачевании ран, Монахиня призывает Божью благодать для исцеления всех раненых в сражении.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2517',
      text:
          'Аббатиса, обращаясь к Всевышнему, просит его дать ей божественные силы для исцеления раненых бойцов.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2518',
      text:
          'Существо, обладающее гигантской мощью и ростом. Благодаря своей огромной силе, легко крушит слуг Зла.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2519',
      text:
          'Благородный воин, одетый в изящные доспехи и вооруженный мечом гнева, способен легко преодолевать любые преграды благодаря своему крылатому скакуну.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2520',
      text:
          'Следопыт легко покрывает огромные расстояния и часто выполняет разведывательные миссии по приказу своего Императора.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2521',
      text:
          'Архимаг единственный, кто обладает в пределах Империи тайным знанием, благодаря которому он может использовать магические жезлы и свитки.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2522',
      text:
          'Архангел расширяет границы Империи, водружая Жезлы Власти. Земля волшебным образом вокруг них преображается и становится плодородной.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2523',
      text:
          'Воры являются мастерами обмана, поэтому они могут незаметно пробраться в тыл врага и добыть необходимые Империи сведения.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2524',
      text:
          'Оживший доспех обладает огромной мощью. Он вооружен крепким клинком, несущим смерть врагам.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2525',
      text:
          'Магический земляной Голем подчиняется своему создателю; он остановится только тогда, когда его безжизненное тело обратится в пыль.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2526',
      text:
          'Огромная сила и неустрашимый характер позволяют Метателю топоров поразить любую цель на поле боя.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2527',
      text:
          'Их стрелы летят быстро и бьют точно в цель, поэтому каждый залп Арбалетчиков несет смерть врагам.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2528',
      text:
          'Ни один враг не может устоять на поле боя, когда на него идет стена огня, ниспосланная Метателем огня.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2529',
      text:
          'Холмовой великан обладает столь великой силой, что оружием ему служат вырванные с корнем деревья.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2530',
      text:
          'Исполинский Горный великан с легкостью поднимает огромные каменные глыбы и швыряет их во врагов.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2531',
      text:
          'Они спускаются с заснеженных горных вершин, чтобы обрушить на врага лавину смертоносных молний.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2532',
      text:
          'Ледяной великан спускается с холодных горных вершин, чтобы сражаться под знаменами Кланов и крушить противника мечом холода.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2533',
      text:
          'Благодаря знанию лечебных трав Травница может увеличивать силу своих соратников по ратному делу.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2534',
      text:
          'Магические зелья Посвященной увеличивают повреждения, наносимые воинами врагу во время сражения.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2535',
      text:
          'Владея тайным знанием, Друид не только лечит своих союзников, но и может увеличить силу их оружия.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2536',
      text:
          'Гном яростно бросается в битву, срубая головы врагам, при этом зная, что Вотан защитит храброе сердце.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2537',
      text:
          'Воин всегда готов к битве, поэтому его топор наточен, а доспехи начищены до блеска. Во славу своего бога Вотана, он готов сражаться в любое время и в любом месте.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2538',
      text:
          'Ветеран победил во многих битвах, а число павших врагов от его топора не поддается счету. А если придется ему погибнуть в бою, то умрет он как истинный воин.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2539',
      text:
          'Гномы, в награду за небывалую доблесть в бою провозглашенные Ярлами своих кланов. Они носят лучшие из гномьих доспехов.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2540',
      text:
          'Долгие годы проведшие в схватках, Древние ветераны сражаются со свирепостью, данной тем, кому пир Валгаллы слаще жизни.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2541',
      text:
          'Закаленные суровым климатом Горцы осыпают врага дождем ледяных осколков, отколотых от горных ледников.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2837',
      text:
          'Белые медведи обитают в заснеженных горных пещерах; они не будут рады непрошеным гостям.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2543',
      text:
          'Покрытые толстой шкурой, Йети своим ледяным дыханием отправили в могилу многих приспешников врага. Урон 35 +10 за уровень.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2544',
      text:
          'Живущие лишь битвами, Королевские стражи готовы уничтожить любую опасность, грозящую землям Гномов.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2545',
      text:
          'Инженеры много путешествуют, сообщая Верховному Королю обо всем, что происходит в Землях Гномов.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2546',
      text:
          'Владеющие знанием из поколения в поколение передают мудрость Кланов и могут пользоваться магическими жезлами и свитками.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2547',
      text:
          'Избранник Вотана, Старейшина расширяет владения Верховного Короля, водружая жезлы власти.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2548',
      text:
          'Вор знает множество способов, благодаря которым он сможет выполнить самое деликатное поручение Верховного Короля.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2549',
      text:
          'Рух - гигантские птицы, которых во времена войны призывают сражаться Горные Кланы.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2550',
      text:
          'Не каждый смертный выдержит встречу с этими девами-воительницами, парящими над полем боя и собирающими души павших.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2551',
      text:
          'В эти огромные статуи вселяются души самых неистовых воителей древности.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2552',
      text:
          'Повелители демонов порабощают души самых сильных крестьян для участия в дьявольских битвах.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2553',
      text:
          'Берсеркер всегда бросается в бой с отчаянной решимостью, готовый сражаться до тех пор, пока последний враг не испустит дух.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2554',
      text:
          'Душами этих некогда святых воинов овладели демоны, их верная служба Церкви осталась далеко в прошлом.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2555',
      text:
          'Те, кто слепо повиновался приказам жестоких командиров, после смерти превращаются в каменных демонов; в адском огне их тела становятся столь же каменными, как их души.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2556',
      text:
          'Мраморные горгульи - крылатые демоны шестого круга Ада; они невосприимчивы к направленным на сознание атакам, а каменная шкура делает их почти неуязвимыми.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2557',
      text:
          'Эта нечестивая тварь наводит ужас на смертных к вящей славе князя Тьмы Бетрезена, в бою сей воин почти непобедим.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2558',
      text:
          'Демоны населяют последние круги Ада и своей силой превосходят большинство других его обитателей.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2559',
      text:
          'Молохи приобретают силу и могущество, пожирая души тех, кого убивают. В бою они не жалеют своих противников.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2560',
      text:
          'Исполинская Тварь - истинное воплощение Зла. Как гласят древние легенды, еще никому не удавалось уйти от него.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2561',
      text:
          'Повелитель демонов - один из владык Ада. Он ведет армии Бетрезена к славе и величию, сметая все преграды на своем пути.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2562',
      text:
          'Люди, имеющие врожденную тягу ко злу; по приказу своего бога они готовы истребить любого врага с помощью адского огня.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2563',
      text:
          'Благодаря своей магической силе Темные колдуны могут призвать огненный дождь для уничтожения сил врага.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2564',
      text:
          'Демонолог вызывает огненный шторм такой силы, что ни одно войско не спасется от него.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2565',
      text:
          'Своим смертоносным криком Инкуб превращает людей в камень, который уже никому не причинит вреда.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2566',
      text:
          'Пандемонеусу подвластен адский огонь, который за одно мгновение может испепелить целые армии.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2567',
      text:
          'Ведьмы обитают в глуши лесов; на смертных, осмелившихся потревожить их покой, они насылают порчу.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2568',
      text:
          'Колдуньи могут превращать врагов во что пожелают. После такой метаморфозы противнику уже не до битвы с врагом.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2569',
      text:
          'Манкуб прячет свое бесформенное тело в подземном лабиринте. Немногие могут выдержать его неистовую атаку.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2570',
      text:
          'Воинственный дух Герцога ведет демонов в бой; когда их возглавляет Герцог, им не страшны никакие противники.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2571',
      text:
          'Советник ведет передовые отряды Проклятых, а благодаря своим быстрым крыльям, ему не страшны никакие природные преграды.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2572',
      text:
          'Архидьявол - хранитель запретного знания, поэтому ему ведомы тайны магических жезлов и свитков.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2573',
      text:
          'Баронесса способна превратить цветущую долину в выжженную пустыню, где не останется ничего живого.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2574',
      text:
          'Вор является непревзойденным мастером диверсий и шпионажа, каждый раз выполняя порученные ему задания.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2575',
      text:
          'Трехголовый Цербер охраняет обитателей Ада своим огненным дыханием.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2576',
      text:
          'Гигантский демон Белиарх пронзает противников своими жуткими рогами.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2577',
      text:
          'Мститель карает тех, кто усомнился в величии Бетрезена, правителя Ада.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2578',
      text:
          'Груз совершенных при жизни грехов навеки приковал эти неприкаянные души к бренному миру смертных. Теперь они присоединились к великому походу Нежити.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2579',
      text:
          'Одного взгляда Призрака достаточно, чтобы кровь застыла в жилах, и смертельный холод сковал все тело.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2580',
      text:
          'Одним своим видом Адепты наводят страх на простых смертных, на поле же боя они сеют смерть и болезни.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2581',
      text:
          'Человеческие страдания, боль и несчастья дают Колдунам необходимую силу, чтобы творить свое черное дело и насылать на земли Невендаара всевозможные эпидемии.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2582',
      text:
          'Перед черными силами, которыми овладел Некромант, не устоит ни одна армия из простых смертных.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2583',
      text:
          'Люди, отвергнувшие слово Всевышнего, становятся Вампирами. Они поддерживают свое существование за счет жизненной силы невинных жертв.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2584',
      text:
          'Те, кто приобщился к тайнам магии при жизни, становятся Личами; они насылают на живых смертоносную чуму.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2585',
      text:
          'Злые Духи приходят из преисподней на земли Невендаара, чтобы сеять смерть и мор среди живых.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2586',
      text:
          'Когда-то эти воины пали на поле брани, но теперь Мортис призвала их под свои знамена, и они снова вынуждены сражаться.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2587',
      text:
          'Благодаря темному ритуалу души когда-то умерших живых существ отныне превратились в лишенных любых эмоций Зомби.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2588',
      text:
          'Скелет-воин поднялся из земли по приказу Мортис и теперь сражается с любым противником, защищая интересы Нежити.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2589',
      text:
          'Непобедимый Скелет-рыцарь возглавляет великий поход против смертных; устоять перед его мощью никто не в силах.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2590',
      text:
          'Тамплиеры извращают религиозные догматы во славу королевы Мортис. Над ними не властна магия стихий.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2591',
      text:
          'В награду за преданную службу, Мортис, богиня мертвых, дарует Лордам Тьмы власть над стихиями.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2592',
      text:
          'Оборотень выходит на свою охоту при свете Луны, убить его простым мечом практически невозможно.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2593',
      text:
          'Колдуны оживляют мертвых драконов, создавая Виверн, которые сражаются за Орды нежити.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2594',
      text:
          'Эти устрашающие существа дышали огнем, пока были живы - теперь они изрыгают ядовитые испарения.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2595',
      text:
          'Драконы наводят ужас на страну даже после смерти. Их ядовитое дыхание во время битвы окутывает целые армии.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2596',
      text:
          'Жестокость Рыцаря Смерти в бою не знает предела. Умение руководить и способность к передвижению по воздуху делают из него непревзойденного воина.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2597',
      text:
          'Носферату высасывают жизненную силу из своих врагов, ослабляя их и питая свои собственные черные души.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2598',
      text:
          'Женщины-некроманты после смерти превращаются в жутких Королев личей. Их темные знания позволяют им использовать силу, заключенную в магических жезлах и свитках.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2599',
      text:
          'Благодаря жезлам Баньши способны обратить цветущие земли в бесплодную пустыню, где не останется ничего живого.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2600',
      text:
          'Вор отправляется во вражеские города по первому приказу короля. Обман и хитрость - его главное оружие.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2601',
      text:
          'Орды нежити используют в качестве разведчиков скелеты, оживленные колдовством.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2602',
      text:
          'Темная магия обратила часть древесного народа Энтов в злобных Хуорнов.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2603',
      text:
          'Кошмары - безумные создания, порожденные воображением темных колдунов, несут смерть врагам Мортис.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2604',
      text:
          'По приказу Мортис сама Смерть приходит, дабы собрать свою кровавую жатву.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2605',
      text:
          'Адская гончая несется в атаку, извергая огонь. По природе это всего лишь морок, неуязвимый для магических атак.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2606',
      text:
          'Белиарх своими рогами сразит любого, кто встанет на пути Бетрезена.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2607',
      text:
          'Мститель - это огненное существо, чье пламя сжигает неприятельские отряды.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2804',
      text:
          'Эти яростные твари непрерывно бороздят облачные выси Невендаара в поисках кровавой добычи. Жестокая смерть таится на кончиках их когтей и клювов.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2832',
      text:
          'Племена варваров приходят из Северных степей, призванные своими вождями на поиски богатой добычи. Ярость духов наносит на 90 урона меньше, чем основная атака.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2801',
      text:
          'Крестьяне готовы умереть за маленький клочок земли, который они называют домом.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2819',
      text:
          'Мифические Красные драконы обитают вблизи вулканов и потоков лавы. По слухам, они живут больше четырех тысячелетий.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2824',
      text:
          'Люди-ящеры - странные порождения болот; говорят, они особенно ценят человеческое мясо.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2825',
      text:
          'Горгоны живут по одиночке в безлюдных местах; их взгляд обращает в камень тех, кто подошел слишком близко.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2815',
      text:
          'Людоеды - не слишком умные воины; они нападают, не задумываясь о военных хитростях и тактике. Сокрушение наносит на 110 урона меньше, чем основная атака.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2830',
      text:
          'Разбойники объединяются в шайки, чтобы грабить неосторожных путников и беззащитных крестьян.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2805',
      text:
          'Лесные эльфы никогда не теряют бдительности, следя за неприятелем и готовясь отразить любое вторжение.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2806',
      text:
          'Эльф-оракул не только оповещает свой народ о воле Богов, но и способен исцелять самые тяжелые раны.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2816',
      text:
          'Тролли невероятно сильны и нечувствительны к ранам: любая отрубленная часть тела быстро отрастает.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2826',
      text:
          'Русалка, очаровав путника своим сладким пением, с наслаждением затем пожирает его сладкое мясо.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2812',
      text:
          'Орк-багатур ведет в бой свои зеленокожие отряды. Только "Большеротые" орки могут дослужиться до этого звания.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2817',
      text:
          'Гоблины - дальние родственники орков. Они не отличаются силой, но хитры и проворны.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2807',
      text:
          'Горячая кровь течет у Кентавров в жилах, и они готовы сразиться с любым врагом.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2813',
      text:
          'Орки из клана "Малого рта" всегда считались крепкими воинами, поэтому в бою их ставят в первых рядах.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2802',
      text: 'Наемники готовы воевать хоть за самого черта - лишь бы платил.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2808',
      text:
          'Повелитель Эльфов всегда сможет защитить свой народ, наслав на врага бурю.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2809',
      text:
          'Эльф-следопыт осыпает врагов стрелами - меткость его не уменьшается с расстоянием.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2803',
      text: 'Копейщик будет насмерть стоять за того, кто больше заплатит.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2833',
      text:
          'Упыри - опасная нежить; они нападают на тех, кто оказался поблизости, предварительно одурманив свою жертву.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2834',
      text:
          'Демоны насылают в земли врагов с пакостными поручениями подлых Бесов.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2820',
      text:
          'Мифические Белые драконы являют собой редкостное, завораживающее зрелище. Рассказывают, что они живут по три тысячи лет.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2821',
      text:
          'Мифические Синие драконы селятся возле воды. По слухам, они живут свыше трех тысяч лет.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2822',
      text:
          'Мифические Черные драконы живут в самом сердце пустыни. Согласно преданиям, их жизнь длится около четырех тысяч лет.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2823',
      text:
          'Мифические Зеленые Драконы прячутся в лесных чащах. По слухам, они живут по три тысячи лет.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2810',
      text:
          'Пернатые акулы небосклона, эти грозные хищники безраздельно властвуют среди облаков.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2835',
      text:
          'Гигантские пауки очень ядовиты; они бросаются на тех, кто неосторожно к ним приблизился.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2829',
      text:
          'Ужас морских глубин - Морской змей - потопил много больших военных кораблей.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2827',
      text:
          'Природный враг Морского змея - Кракен - нападает на мореплавателей, оказавшихся слишком близко к его подводной пещере.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2814',
      text:
          'Ханы Орков захватывают трон в смертельной схватке с прежним правителем - они сильнейшие в своем племени.',
