    ));
    objects.add(Tglobal(
      txt_id: 'x000tg8051',
      text:
          'Редкие травы, содержащиеся в составе этого зелья, способны заставить замолкнувшее сердце биться вновь.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg8052',
      text:
          'Эта настойка на выжимке из коры вяза временно делает кожу и плоть выпившего ее прочнее (15 к броне).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg8053',
      text:
          'Особый отвар из корней молодого дуба способен на время придать коже выпившего его прочность коры векового древа (30 к броне).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg8054',
      text:
          'Лишь лучшие алхимики Теней Инквизиции знают рецепт этого чудодейственного зелья, которое укрепляет веру и поднимает боевой дух (дарует защиту от магии Разума).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg8055',
      text:
          'Этот повсеместно распространенный отвар используют для скорейшего заживления неглубоких ран (исцеляет 50 ОЗ).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg8056',
      text:
          'Ингридиенты этого зелья способствуют скорейшему выздоровлению выпившего его и исцелению его ранений (исцеляет 100 ОЗ).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg8057',
      text:
          'Этот необычайно редкий эликсир готовят из цветов, выросших на могилах святых. Один глоток этого напитка способен прибавить десяток лет жизни (50% к ОЗ на один день).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg8058',
      text:
          'Глоток этого зелья помогает сконцентрироваться на сражении, беспроигрышно находя брешь в обороне противника и нанося туда точный удар (15% к меткости).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg8059',
      text:
          'Отхлебнув этого эликсира, воин приобретает сверхъестественную сосредоточенность, с легкостью обнаруживая и поражая дыры даже в самой совершенной обороне (30% к точности).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg8060',
      text:
          'Один глоток этого варева моментально делает выпившего значительно выносливее, хотя бы на один день (+50 к максимуму ОЗ).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg8061',
      text:
          'Травы этой настойки придают выпившему ее невиданную ловкость и гибкость. Нередко ее можно найти в вещах канатоходца или акробата (15% к инициативе).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg8062',
      text:
          'Выпивший это зелье приобретает скорость ветра и увертливость падающего листа. В бою он способен наносить вихрь ударов, уклоняясь от выпадов противника (30% к инициативе).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg8063',
      text:
          'Сваренный из крови оборотня, этот эликсир дарует выпившему его защиту от оружия на один день.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg8064',
      text:
          'Мышцы выпившего этот настой наполняются дикой силой, способной сокрушать даже самых стойких и умелых противников (15% к урону).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg8065',
      text:
          'Этот редчайший эликсир готовят из корня мандрагоры. Атаки выпившего эликсир, сметают все на своем пути, подобно разбушевавшемуся тайфуну (30% к урону).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg8066',
      text:
          'Рецепт этого варева держится в строжайшей тайне, лишь искуснейшие алхимики и некромаги способны создать подобное (50% нанесенного целью урона переводится в ее здоровье).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg8067',
      text:
          'Перечислять все ингридиенты этого зелья не имеет смысла, ибо их бесчисленное множество, но важно лишь то, что кожа выпившего становится прочной как сталь (+50 брони).',
      verified: false,
      context: "",
    ));
