          'На обороте флага вышит девиз, укрепляющий веру воинов в их командира: "Солдат, не спрашивай себя, что, как и почему. Коль знамя в бой ведет тебя, шагай вослед ему!" (+10 брони).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg8122',
      text:
          'Этот штандарт зачарован магией гор - стоит ветру шевельнуть флаг - в шорохе ткани слышится тихий напев: "Кто свободен и прав - тот вдвойне защищен, кто в бою не один - тот не будет сражен" (+15 брони).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg8123',
      text:
          'Знамя Леонарда Мудрого, лишь разумом своим сокрушившего вражеское войско единственным точным ударом. Сила - в правде, и "есть еще, как он, пророки, Святые рыцари добра" (+10% точности).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg8124',
      text:
          'Знамя первого Легиона: "они были преданы и продали души в обмен на месть: так правда, ополчась на ложь, повергнет в прах и тлен тех, кем однажды предан был Создатель - Бетрезен!" (+15% точности).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg8125',
      text:
          'Завитки золотого узора на знамени складываются в воинский девиз: "Лишь тот надежно защищен, кто быстр, отважен, и хитер. Кто первым нанесет удар - не будет в битве побежден!" (+10% инициативы).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg8126',
      text:
          'Этот штандарт со словами: "Сим победиши!", был ниспослан ангелами императору Константину накануне битвы за Империю. После победы в битве, знамя мистическим образом исчезло (+15% инициативы).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg8127',
      text:
          'На этом турнирном полотнище начертан девиз: "Если хочешь преуспеть, и врага сразить, надо сильно попотеть, силы приложить!" (+10% урона).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg8128',
      text:
