    objects.add(Tglobal(
      txt_id: 'x000tg8253',
      text:
          'Этот браслет создан одним из некромантов, дабы компенсировать его слабость в ближнем бою. Души, удерживаемые при помощи магии, оберегают владельца браслета (+20 брони, 10% регенерации).',
