    ));
    objects.add(Tglobal(
      txt_id: 'x000tg8725',
      text:
          'Мечта кладоискателя. Украшения из рубинов не брезгуют носить князья и даже короли (стоимость 250).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg8726',
      text:
          'Переливающийся всеми цветами радуги, сапфир особо ценится среди весьма состоятельных горожан (стоимость 300).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg8727',
      text:
          'Самый редкий и самый дорогой камень. Опытные ювелиры делают из этого материала произведения искусства. В народе алмаз зовут королевским камнем (стоимость 350).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg8728',
      text:
          'Части некогда великого артефакта либо символы поклонения забытым богам, такие реликвии очень ценятся торговцами, продающим их втридорога богатым искусствоведам-историкам (стоимость 400).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg8729',
      text:
          'Скипетры часто подделывают умелые мастера в угоду самовлюбленным вельможам. Сделаны они не хуже королевских. Настоящий же королевский скипетр всего один (стоимость 500).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
