    objects.add(Tglobal(
      txt_id: 'x000tg2650',
      text:
          'Владея тайным знанием, Патриарх способен своими молитвами и обрядами воскрешать павших на поле боя воинов.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2651',
      text:
          'Прорицательница способна обращаться к Всевышнему напрямую; благодаря полученной силе, она способна излечивать раненых прямо на поле боя.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2652',
      text:
          'Белый маг лучше всех владеет магией воздуха, что позволяет ему создать вокруг себя практически нерушимый щит, принимающий на себя вражеские атаки.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2653',
      text:
          'Ученик-элементалист, на поле боя в помощь своим соратникам вызывает могущественных воздушных элементалей.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2654',
      text:
          'Ассасин вооружен кинжалом, который отравлен смертельным ядом. Передвигаясь молниеносно, он способен поражать любого противника на поле боя.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2655',
      text:
          'Мастер клинка в совершенстве овладел древним искусством боя двумя мечами, что позволяет ему сражаться с противником без доспехов и наносить два удара.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2656',
      text:
          'Паладину дарованы лучшие доспехи в Империи, чтобы он на поле брани мог стойко сражаться, уничтожая своим острым мечом приспешников сил Зла.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2657',
      text:
          'Великий инквизитор стоит на страже чистоты веры в Империи. Вооруженный святой булавой, в бою он не знает страха, нанося смертельные удары приспешникам Тьмы.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2658',
      text:
          'Наместники Вотана в совершенстве владеют искусством ведения войны, поэтому они являются самыми почитаемыми воинами.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2659',
      text:
          'Величайших воинов Горных кланов зовут Сыны Имира. Они настолько сильны, что могут убить противника одним ударом.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2660',
      text:
          'Архидруид во время битвы выдает воинам специальное зелье, которое придает им большую ярость и силу в бою.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2661',
      text:
          'Алхимики налагают на воинов чары, позволяющие им атаковать в битве на один раз больше.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2662',
      text:
          'Защитник горна тщательно подготавливает свое оружие к каждой битве; стрелы его арбалета несут врагам смерть.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2663',
      text:
          'Отшельник владеет Рогом войны, чей звук созывает бойцов всех Горных Кланов на смертельную битву с врагом.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2664',
      text:
          'Дикие волки послушны своему Повелителю, который может призвать их в любой момент для борьбы с врагами.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2665',
      text:
          'Мастер рун, познав тайную силу рунических надписей, выковал себе уникальный боевой топор, которым во время битвы крушит своих противников.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2666',
      text:
          'Эти рыцари, некогда служившие Всевышнему, продали свои души Бетрезену. В адских когортах их научили заращивать на себе самые ужасные раны.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2667',
      text:
          'Закаленные огнем преисподней, Ониксовые горгульи являются одними из самых сильных бойцов армии Бетрезена.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2668',
      text:
          'Бетрезен освобождает прикованного к адскому трону Тиамата только во время своих самых больших безумств.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2669',
      text:
          'Владыка держит в повиновении непокорных обитателей Ада, но бывает, его помощь нужна и на земле.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2670',
      text:
          'Демон Бездны редко покидает адские бездны. Его появление вселяет страх даже в самых бывалых воинов.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2671',
      text:
          'Двойник обладает способностью полностью менять свой облик, вводя врагов в заблуждение и используя их возможности.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2672',
      text:
          'Пламя Модеуса, черпающего силы в геене огненной, несет врагам гибель, от которой невозможно убежать.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2673',
      text:
          'Суккубы - демоны, не желающие расставаться с земными наслаждениями. Они могут превратить противника во что угодно.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2674',
      text:
          'Страх, который исходит от Тени, настолько силен, что противника просто парализует, лишая при этом возможности сопротивляться.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2675',
      text:
          'Верховный вампир способен обмануть даже смерть; для этого он ворует жизненную силу у противника.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2676',
      text:
          'Колдун, чьим магическим изысканиям не стала помехой даже сама смерть, становится Архиличом.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2677',
      text: 'Воплощение и вестница Смерти, собирающая души в землях живых.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2678',
      text:
          'Воины-изменники ведут охоту на живых в обличье отвратительных Сущих, для которых не существует никаких преград.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2679',
      text:
          'Воины, предавшие своих товарищей, отныне вынуждены сражаться вечно, пока им не будет даровано прощение.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2680',
      text:
          'Вирм призван внушать своим видом страх в души бойцов противника, чтобы залить землю ядом своей злобы.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2681',
      text:
          'Огромный оживший дракон наводит ужас на своих врагов, а своим ядовитым дыханием отравляет воздух на поле битвы.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2818',
      text:
          'Гоблины-лучники сопровождают своих товарищей в засадах и нападениях, используя против врагов свои грубые стрелы.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2831',
      text:
          'Головорезы прекрасно разбираются в ядах, что делает их куда опаснее простых разбойников.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2701',
      text:
          'Ребенок, рожденный от женщины, соблазненной инкубом, с самого рождения одержим адскими силами и обладает ужасными способностями.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2702',
      text:
          'Падшие - это первые из ангелов, которые остались верны Бетрезену и были вместе с ним низвергнуты в преисподнюю. Их облик столь же ужасен, как и облик их владыки.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2703',
      text:
          'Элементали Воздуха служат Повелителям стихий, которые призывают их из Сферы Воздуха.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2704',
      text:
          'Бесы - слуги из верхних кругов Ада; демоны с их помощью сеют смуту в королевстве. Урон 10 +10 за уровень.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2708',
      text:
          'Влиятельные и богатые, Бароны являются полноправными хозяевами в своих владениях и подчиняются лишь императору.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2706',
      text:
          'Самые достойные воины Горных Кланов ведут за собой свой народ. Крайне редко ими становятся женщины.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2710',
      text:
          'Это древнее чудище обитает в болотах и несет смерть каждому, кто имел неосторожность потревожить его.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2705',
      text: 'Искусный маг, сведущий в секретах древних рун.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2709',
      text:
          'Женщины-некроманты редки в Невендааре, но те немногие, что еще плетут в нем свои интриги, по своей мощи далеко превосходят некромантов-мужчин.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2707',
      text:
          'Жрецы - правители темных эльфов. Они беспрекословно исполняют волю Мортис, которая их создала.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2711',
      text:
          'Лишь самые могучие из демонов способны вести легионы проклятых к победе.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2712',
      text: 'Разрозненные племена Диких великанов держатся особняком.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2713',
      text:
          'Адепт культа Смерти, Оккультист может призвать мертвых на службу своим темным владыкам.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2714',
      text:
          'Магистр черного культа Ниграэля может призывать души мертвых и повелевать ими.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2715',
      text: 'Слава о Верховном повелителе Гномов гремит по всему королевству.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2716',
      text:
          'Считалось, что Мантикора - мифическое чудовище, живущее только в легендах.',
      verified: false,
      context: "",
