    objects.add(Tglobal(
      txt_id: 'x000tg9201',
      text:
          'По легенде, этот талисман был подарен одной девушке ее возлюбленым, молодым скваером. Он обещал ей, что как бы далеко он ни был - она сможет призвать его сим талисманом (призыв Сквайра).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg9202',
      text:
          'При крещении каждый житель империи получает символ ангела, призваный защитить его от всех невзгод. Некоторые такие амулеты способны действительно призвать в мир небесного хранителя (призыв Ангела).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg9203',
      text:
          '"Почитай предков своих, и мудрый прадед не оставит тебя в трудный час" - гласят руны на этом обереге (призыв Старого ветерана).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg9204',
      text: 'Вызывает Беса.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg9205',
      text:
          'Обагрив этот амулет кровью невинного создания, можно призвать из преисподней адского воина, одержимого только стремлением убивать (призыв Возвышенного).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg9206',
      text:
          'Нечестивое ожерелье, созданное грешным магом для утоления своих извращенных желаний. Вызывает инкуба, но цена этой услуги никогда не сотрет пятна с души заклинателя (призыв Инкуба).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg9207',
      text:
          'Могущественный амулет некромагии, наделенный властью поднимать из-под земли погребенных (призыв Зомби).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg9208',
      text:
          'Однажды орден рыцарей единорога поклялся хранить владельца такого амулета вечно. Рыцарская клятва нерушима даже в посмертии (призыв Скелета-рыцаря).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg9209',
      text:
          'Один из величайших магов сумел заключить сердце бессмертного основателя вампирского рода в этот талисман. С тех пор потомки этого рода идут за зовом крови (призыв Вампира).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg9210',
      text:
          'Эта филактерия окружена вязью могущественых заклятий, заставляющих лича служить владельцу дольше обычного (призыв Лича).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg9211',
      text:
          'Этот талисман являлся очень древним символом, призывавшим Верховных Вампиров на особенный ритуал. Несмотря на разрушение древнего договора, сила талисмана сохранилась (призыв Верховного вампира).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg9212',
      text:
          'В этом ювелирном украшении использовались частички тех древних деревьев, из которых вышли эльфы на заре веков. Он до сих пор хранит часть силы Галлеана (призыв Повелителя эльфов).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg9213',
      text:
          'Если взмахнуть этим талисманом, он призовет на службу его хозяину поддерживаемые святым духом доспехи (призыв Ожившего доспеха).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg9214',
      text:
          'Дикарское украшение, символизирующее орочью большеротость. Любой малоротый орк должен признать владельца этого талисмана своим командиром. Некоторые действительно признают (призыв Орка).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg9215',
      text:
          'Когда культура змеекожих была на пике, такие талисманы носили шаманы Агшлизга. Некоторые люди-ящеры до сих пор готовы выступить на стороне того, кто носит этот символ (призыв Ящера-воина).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg9216',
      text:
          'Основательницы целительского Ордена Трех Сестер поклялись всегда помогать нуждающимся и создали подобные артефакты, которые до сих пор содержат частицы их душ (призыв Архидруида, Прорицательницы или Солнечной танцовщицы).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg9217',
      text:
          'Приговор судьи исполняется незамедлительно, ибо благодаря своей магической броши он способен призвать исполнителей своего приговора (призыв Великих инквизиторов на все поле боя).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg9218',
      text:
          'Благодаря подобным кольцам служители Ордена всегда приходят на помощь тем, кто в ней нуждается. К сожалению, эти кольца зачастую попадают в злые руки (призыв Хранителя ордена).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg9219',
      text:
          'Благословленные Его Святейшеством Патриархом Империи Августом Третьим, подобные талисманы способны призвать на поле брани спасителей рода людского (призыв Ангелов на все поле боя).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg9220',
      text:
          'Четыре стихии бушуют внутри этого ларца и готовы вырваться на волю по приказу своего повелителя (призыв элементалей Воздуха, Воды, Земли и Огня на все поле боя).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg9221',
      text:
          'Шаманы используют подобные талисманы, чтобы советоваться с душами мудрейших. И порой эти души могут встать на защиту юного шамана (призыв Шаманки, Старейшины Гоблинов, Гоблина-громыхуна или Гоблина-шамана).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg9222',
      text:
          'Величайший дар драконьего рода, этот амулет позволяет призвать сильнейших существ Невендаара на свою сторону (призыв Зеленого, Красного, Белого, Синего, Черного, Желтого или Кровавого дракона).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg9223',
      text:
          'И да откроется Геена Огненная пред тем, кто владеет этим амулетом, и да выйдут из нее Когорты Адские, и да посеют они хаос в рядах врагов (призыв Герцогов, Архидьяволов и Возвышенных на все поле боя).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg9224',
      text:
          'Владеющий сердцем Дхампира, способен призвать его на свою сторону в любой момент (призыв Дхампира).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg9225',
      text:
          'Активированный, этот талисман издает ужасающий вой, который привлекает всех оборотней в округе на защиту своего владельца (призыв Оборотней, Волколаков, Хортов и Чумных оборотней на все поле боя).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg9226',
      text:
          'Поставленный на землю, сей талисман начинает излучать некроэнергию, тем самым анимируя нежить под знамена своего владельца (призыв Призраков, Драконов Рока и Скелетов-воинов на все поле боя).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg9227',
      text:
          'Придворные маги Империи даруют своему сюзерену подобные талисманы, позволяющие в нужное время оказаться рядом со своим повелителем (призыв Белого мага).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg9228',
      text:
          'Великаны грозовых вершин всегда готовы придти на помощь тому, у кого в руках сей талисман  (призыв Повелителя бурь или Наместника Вотана).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg9229',
      text:
          'Души сильнейших хищников суши хранятся в этом талисмане. При умелом использовании можно призвать сии души на свою защиту (призыв Бурого или Белого медведя).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg9230',
      text:
          'Стоит воткнуть этот талисман в землю, как он тут же обрастет землей, и пред врагами предстанет могучий каменный голем (призыв Голема).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg9231',
      text:
          'Души морского народа, закованные в этом предмете, вынуждены прислуживать владельцу этого талисмана  (призыв Русалок, Наяд, Никс, Тритонов и Кракенов на все поле боя).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg9232',
      text:
          'Ужас глубин, морской змей, встанет на защиту того, кто владеет этим талисманом (призыв Морского змея).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg9233',
      text:
          'Колоссальное количество некроэнергии струится по этому талисману, и, в случае необходимости, он может анимировать драконов на вашу службу (призыв Дракона Смерти, Вирма или Драколича).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg9234',
      text:
          'Самые омерзительные твари могут быть привлечены под ваши знамена силой этого талисмана (призыв Пауков на все поле боя).',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg9235',
      text:
          'Наиболее преданные слуги Великой Безмясой Богини получают в награду за свою службу такой амулет, способный призвать саму Смерть на поле боя, дабы обратить неверных в истинную веру (призыв Танатосов и Кошмаров на все поле боя).',
