    objects.add(Tglobal(
      txt_id: 'x000tg9604',
      text:
          'Вместе с рунами Вотан послал своему народу свитки, объясняющие их свойства, назначение и способ восстановления сломанных рун.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg9605',
      text:
          'Эта магическая руна гномов означает обновление и перерождение, избавление от старого зла и переход в новую эру. Она используется для восстановления сил.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg9606',
      text:
          'Эта магическая руна гномов означает величие, военную мощь и победы в войнах. Она используется для увеличения защиты войск.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg9607',
      text:
          'Эта магическая руна гномов символизирует свободу и независимость, волю и простор. Мастера Рун используют ее для ускорения.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg9608',
      text:
          'Эта магическая руна гномов означает исцеление. С ее помощью мастера рун могут исцелить даже, казалось бы, безнадежно больных.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg9609',
      text:
          'Эта магическая руна гномов символизирует порядок и стабильность, успехи в торговле и ремесле. Мастера Рун используют ее для создания магических преметов.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg9610',
      text:
          'Эта магическая руна гномов означает храбрость и стойкость, бесстрашие, силу и упорство. Мастера Рун используют ее для усиления армии.',
