      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg9611',
      text:
          'Эта магическая руна гномов символизирует богатство, достаток и успех, удачу и трудолюбие. Она используется для благословений.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg9612',
      text:
          'Рог, выточенный из кости неизвестного жителям поверхности морского чудовища. Его звуки священны для всех обитателей водной стихии.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg9613',
      text:
