    ));
    objects.add(Tglobal(
      txt_id: 'x000tg9522',
      text: 'Забальзамированное сердце',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg9620',
      text:
          'Чья-то забальзамированная голова. Судя по огонькам, что светятся в ее глазницах, при жизни ее хозяин обладал недюжинной волшебной силой.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg9621',
      text:
          'У этой мумии не хватает головы, а в сосудах с органами недостает сердца, но все равно окружающая ее аура могущества дает понять, что некогда это был великий герой',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg9622',
      text:
          'Это мумифицированное сердце все еще продолжает биться, толчками изливая наружу светящуюся кровь. Видимо, магическая сила бывшего обладателя все еще поддерживает в нем полужизнь.',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg7652',
      text: 'Магический колодец',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg7653',
