    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2422',
      text: 'Небирос',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2722',
      text:
          'Небирос - тварь, появившаяся из самого сердца подземного мира. Он был окроплен кровью самого Бетрезена, разжигающей пламя чумы повсюду.',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2423',
      text: 'Множество',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2424',
      text: 'Дева битвы',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2425',
      text: 'Исчадие',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2426',
      text: 'Дух волка',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2427',
      text: 'Провидец эльфов',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2428',
      text: 'Вестник Мортис',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2429',
      text: 'Падший инквизитор',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2723',
      text:
          'Множество представляет собой тысячи душ, слившихся воедино. Каждый, кто встанет на пути у Множества, обречен стать его частью.',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2724',
      text:
          'Девы битвы выбираются оракулами среди эльфийских девочек и с самого детства начинают постигать искусство сражения и магии.',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2725',
      text:
          'Это древнее чудовище, обитающее в непроходимых чащобах, - воплощение самого древнего ужаса перед силами природы.',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2726',
      text:
          'Эти зачарованные волки - дети другого мира. Им не нужны клыки и зубы. Они убивают своих врагов одним лишь ужасом своего жуткого Воя.',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2727',
      text:
          'Наделенного даром с рождения, провидца постоянно посещают видения о будущем. Только он способен услышать голос Галлеана в бушующем потоке сознания.',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg2728',
      text:
          'Оживленный Мортис в качестве пародии на то, чем был при жизни, темный эльфийский пророк может вызывать самых ужасных существ из тех, что населяют Невендаар.',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
