    objects.add(Tglobal(
      txt_id: 'x160tg0409',
      text:
          'Лесной Лорд - это эльф чистейших кровей, обнаживший свое оружие во имя защиты своего народа.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x160tg0410',
      text:
          'Дриады - игривые духи деревьев. Самой Природой им дарована возможность пользоваться могучей магией и знать тайны жезлов и свитков.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x160tg0411',
      text:
          'Стражи - это жестокие Кентавры-лучники, быстрые как ветер и выносливые как драконы. Они способны покрывать огромные расстояния.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x160tg0412',
      text:
          'Старейшие из Эльфов, Мудрецы с помощью зачарованных жезлов окутывают магией Рощи весь Невендар.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x160tg0413',
      text:
          'Лунная тень - это шепот ветра в листьях деревьев. Она мастер обмана, неразгаданных загадок, ловких пальцев и безмолвных краж в лунном свете.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x160tg0414',
      text:
          'Отлично владеющий копьем, Кентавр-копейщик - грозный воин, всегда готовый встать на защиту Эльфов.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x160tg0415',
      text:
          'Грозно блистающий доспехами самой тонкой работы, на которую только способны эльфийские мастера, Кентавр-латник ведет в бой кавалерию.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x160tg0416',
      text:
          'Безудержный Кентавр-странник беспощадно прорубает себе путь сквозь полчища врага.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x160tg0417',
      text:
          'Наводящий на врагов панический страх, Кентавр-дикарь забывает себя в боевом безумии кровавого сражения.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x160tg0418',
      text:
          'Эльфийские разведчики могут бесшумно снять врага одной стрелой. И только ощутив наконечник в горле - враг понимает, что он мертв.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x160tg0419',
      text:
          'Эльф-охотник - безжалостнее лесного хищника. Любой, кто оказался в лесу непрошенным гостем, может почувствовать себя на месте его жертвы.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x160tg0420',
      text:
          'Единственный выстрел Эльфа-стингера приводит к неминуемой гибели. Наконечники его стрел смазаны смертельным ядом.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x160tg0421',
      text:
          'Не признающие никаких законов, Бандиты грабят неосторожных путников.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x160tg0422',
      text:
          'Элита Королевской Гвардии, Сторожа зачаровывают свои стрелы могучим волшебством.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x160tg0423',
      text:
          'Стражи создают стрелы Первозданного Пламени и горе захватчикам, осмелившимся переступить границы эльфийских лесов.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x160tg0424',
      text:
          'Часовой обрушивает на врага неистовство самой зимы, осыпая ряды его воинов смертельным дождем ледяных стрел.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x160tg0425',
      text:
          'Адепт экспериментирует со смертоносными силами природы и применяет полученные знания против врага.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x160tg0426',
      text:
          'Чанелер обладает даром направлять бьющую с небес молнию прямо на врага.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x160tg0427',
      text:
          'Находящийся на высшей ступени эльфийского общества, Архонт - это живое олицетворение магии Эльфов.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x160tg0428',
      text:
          'Подчинив себе ярость бури, Тиург вдребезги разбивает броню своих врагов.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x160tg0429',
      text:
          'Величественный Грифон яростно защищает своих эльфийских хозяев от любой опасности.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x160tg0430',
      text:
          'Всего лишь один раз в несколько лет в стае Грифонов рождается Владыка Неба - самый могучий из своих крылатых собратьев. Невероятно предан своим хозяевам - Эльфам.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x160tg0431',
      text:
          'Дух появляется из глубины лесов лишь во время сражений и исцеляет раненых на поле боя.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x160tg0432',
      text:
          'Эльфийские Оракулы не только искусные целители, но и великие провидцы, обладающие способностью прорицать волю Галеана.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x160tg0433',
      text:
          'Лесные Девы священными ритуалами зачаровывают и хранят эльфийский народ, даруя защиту от магии Земли, Воздуха, Огня и Воды всем своим союзникам.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x160tg0434',
      text:
          'Талант Солнечной Танцовщицы к лечению помогает практически сразу вернуться в бой даже тяжелораненым воинам.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x160tg0435',
      text:
          'Сильфиды способны излечить самые страшные раны и избавить эльфийских воинов от последствий самых тяжелых ударов.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x160tg0436',
      text:
          'Волшебное деревце покидает свое место, чтобы встать на защиту леса.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x160tg0437',
      text:
          'Эльфы просят помощи у лесных духов, и нередко на их призыв откликается Энт.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x160tg0438',
      text:
          'Когда в ярости сам лес, просыпается самый могущественный из Энтов, само воплощение природного гнева.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x160tg0439',
      text:
          'Оживленный магией Эльфов, Вердант - это голем, созданный в самом сердце эльфийских лесов.',
      verified: false,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x160tg0440',
      text:
          'Королева Илюмиэль защищает свою землю с помощью могущественной магии, одновременно стараясь примирить своих необузданных подданных.',
      verified: false,
      context: "",
    ));
