    objects.add(Tglobal(
      txt_id: 'x160tgc514',
      text:
          'Примитивное дикарское украшение, сделанное из шипов смертельно ядовитого растения. Дикие эльфы присуждают его самым храбрым и безрассудным воинам своего народа.',
