      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0918',
      text:
          'Построив это здание, вы определите, чему будут обучаться ваши Адепты; приобретя достаточный опыт, Адепты станут Чумотворцами.',
