      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0920',
      text:
          'Надежный воин, возглавляющий стражу замка Императора. Наделен властью вершить суд в делах, не требующих вмешательства правителя Империи. Праведный гнев наносит на 50 урона меньше, чем основная атака.',
