      text:
          'Центральная часть древнего обломка скрижали. От него исходит энергия странной природы.',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0402',
      text: 'Folio de cohortes infernales',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0403',
      text:
          'Книга призыва и подчинения ужасающих тварей, вырывающихся из разлома в сердце преисподней.',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0404',
      text: 'Chirographum detestatus',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0405',
      text:
          'Рукопись, содержащая как впечатляющее количество способов проклясть, так и несколько способов призыва рогатых слуг.',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0406',
      text: 'Manuscript damnati animas',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0407',
      text:
          'Руководство по открытию временных разломов, подходящих для высвобождения большинства дьявольских отродий. При благоприятных обстоятельствах откликнется даже повелитель демонов в сопровождении гарема блудниц.',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0408',
      text: 'Некрономикон',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0409',
      text:
          'Том высшего спиритизма из библиотеки Ниграэля. С помощью него призывают огромные армии мертвых для исполнения воли божества.',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0410',
      text: 'Бельмарт',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0411',
      text:
          'В тени невеендаарских лесов можно найти шаровидные кусты с темно-зелеными листьями, которые можно использовать при лечении заболеваний. Кроме того, бельмарт является важным компонентом множества эликсиров.',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0412',
      text: 'Бледный мак',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0413',
      text:
          'Семенные коробочки этого невзрачного растения в высушенном виде приобретают твердость камня. Без дополнительной обработки они никак не используются.',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0414',
      text: 'Хонхинис',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0415',
      text:
          'Хонхинис можно найти по всей центральной Империи. Невысокое растение с мясистыми и зелеными листьями, в которых содержится сок, способный исцелять ожоги. Также может использоваться в алхимических рецептах.',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0416',
      text: 'Вороний глаз',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0417',
      text:
          'Вороний глаз - одно из популярных целебных растений. Его сок активно используется в алхимии, однако он может исцелять раны и в сыром, необработанном виде.',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0418',
      text: 'Финага',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0419',
      text:
          'Тонкие побеги финаги из южных земель используются для производства разного рода магических эликсиров.',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0420',
      text: 'Желтолунник',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0421',
      text:
          'Обычно из желтолунника делают настойки. Он обладает коротким тонизирующим эффектом. При употреблении без какой-либо обработки он может вызвать легкое отравление.',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0422',
      text: 'Йоруга',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0423',
      text:
          'Этот корешок используется в алхимических рецептах. Йоруга применяется главным образом в лечебных и успокоительных настойках.',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0424',
      text: 'Жабья гнилушка',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0425',
      text:
          'Этот гриб размером с тыкву растет практически везде. Жабья гнилушка не отличается приятными вкусовыми качествами.',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0426',
      text: 'Корневица',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0427',
      text:
          'Под оболочкой темно-зеленого шара из мха скрывается одно из самых редких растений Невеендаара, обладающее целительными свойствами. Растение можно принимать в составе разнообразных эликсиров.',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0428',
      text: 'Верончатка',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0429',
      text:
          'Хотя невзрачную Верончатку можно прикладывать к кровоточащим ранам в свежем виде, она обычно используется в обработанном состоянии. Она является составной частью целого ряда различных магических эликсиров.',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0430',
      text: 'Трутовик',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0431',
      text:
          'Трутовик сначала вымачивается в растворе соли, а потом тщательно высушивается. После этого он очень легко воспламеняется. С помощью этого гриба огонь можно развести практически в любую погоду.',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0432',
      text: 'Гриб глаутамаш',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0433',
      text:
          'Ингредиент мощнейшего противоядия, но при неправильной обработке сам может стать причиной сильнейшего отравления.',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0434',
      text: 'Мандрагора',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0435',
      text:
          'Мандрагора - небольшое невзрачное растение с узкими листьями с зазубренными краями. Мандрагоре приписываются волшебные свойства и она является важным магическим катализатором.',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0436',
      text: 'Смесь трав',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0437',
      text: 'Смесь лучших трав с приятным запахом для приготовления эликсиров.',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0438',
      text: 'Регалии грозы',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0439',
      text:
          'Необычайной красоты кристалл, сверкающий изнутри молниями. Временами он испускает разряды, способные оглушить неосторожного владельца. Лишь сильнейшие аэроманты способны совладать с тем, что скрывается в них.',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0440',
      text: 'Стонущий кристалл',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0441',
      text:
          'Кристалл, покрытый трещинами, издающими нечеловеческие вопли и звериное рычание. Несведущий в магии может умереть от попеременно исходящих из него испепеляющего жара или могильного холода.',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0442',
      text: 'Дьявольский самородок',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0443',
      text:
          'Несколько сплавленных воедино сталактитов, образующих запечатывающий камень, держат взаперти одно из существ Невендаара. Сорвавшему печать полагается награда в виде смертельного проклятья, как гласит предание.',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0444',
      text: 'Вечный лед',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0445',
      text:
          'Оледеневший обломок из недр горы с особым свойством: если им прикоснуться к огню, то он покроется инеем, а затем заледенеет навсегда. Только первородное пламя сможет растопить его и высвободить душу, замороженную в нем.',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0446',
      text: 'Контракт фамильяра',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0447',
      text:
          'Многогранный магический атрибут, в который помещается душа, с которой волшебник заключил договор: заключенный получает душу хозяина после его смерти, но до этого обязуется беспрекословно исполнять любой приказ.',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0448',
      text: 'Эссенция пламени',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0449',
      text:
          'Высшие пироманты создают целые уникальные миры внутри кристаллов. Как они сами утверждают: существа, спрятанные ими от чужих глаз, являются далеко не порождениями пламени и тем более демонов.',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0450',
      text: 'Самоцвет сокрытого измерения',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0451',
      text:
          'Умелые колдуны способны спрятать внутри невзрачных камней абсолютно что угодно, отправив важные артефакты и сокровища в реальность вне времени и пространства.',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0452',
      text: 'Рунный ключ Грозовых врат',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0453',
      text:
          'Ни один ключ не сравнится с руническими ключами по надежности: они защищены сильнейшими магическими оберегами. Иногда другие расы пользуются услугами рунных ключников.',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0454',
      text: 'Рунный ключ Ледяных врат',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0455',
      text:
