    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0478',
      text:
          'Древняя магия возвращает к жизни легендарных животных и вдыхает истый мороз в их кристаллизованное нутро. Так рождается великий Йамму, благословенный самой зимой.',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0479',
      text:
          'В самые неспокойные времена могучие стражи спускаются в Невендаар с целью усмирить врагов Всевышнего.',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0480',
      text:
          'Повелитель темных искусств не подчиняется ни одному из Богов. У него собственные взгляды на устройство мира.',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0481',
      text:
          'Могучий легат возвышается над своим войском. От ее поступи стонет земля, а враги содрогаются от ужаса.',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0482',
      text:
          'Сила проклятий является предметом интереса не только коварных ведьм, но и ведьмаков, постигших эту науку в совершенстве.',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0483',
      text:
          'Члены рыцарских орденов, свернувшие с праведного пути, оставили своих господ на поле боя и больше никогда не смогут прийти в объятия Всевышнего. Урон 60+5 за уровень.',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0484',
      text:
          'Жестокосердечные воины, потерявшие над собой всякий контроль, скитаются по Невендаару, вселяя ужас одним своим видом.',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0485',
      text:
          'Благодаря превосходному чутью ящеры являются лучшими охотниками, а грязные наконечники стрел не просто калечат жертву, но и вызывают болотную лихорадку.',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x000tg0486',
      text:
          'Изобретение гномьих инженеров, призванное помочь валить лес, попав в цепкие лапы гоблинов, превращается в неуклюжую, но опасную боевую машину, управляемую пинками и злобной руганью.',
      verified: null,
      context: "",
    ));
