    ));
    objects.add(Tglobal(
      txt_id: 'x010tg1020',
      text:
          'Даже леса поднимают корни из земли, чтобы дать отпор ненавистным захватчикам (призыв Энта малого).',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x010tg1021',
      text:
          'Даже далекий от темных искусств чародей с помощью этой вещи сможет создать из груды костей покорного слугу (призыв Скелета).',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x010tg1022',
      text:
          'Черные маги, возомнившие, что достаточно познали некромантию, с помощью этих безделушек поднимают с того света целые армии немощных скелетов (призыв Скелетов на все поле боя).',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x010tg1023',
      text:
          'Неопытные последователи Мортис способны только с большим трудом поднять хотя бы одного воина для своей защиты (призыв Воина нежити).',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x010tg1024',
      text:
          'В мирное время мастера рун избирают среди гномов-новобранцев себе учеников, чтобы обучить кузнечному делу (призыв Гнома).',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x010tg1025',
      text:
          'На эльфов то и дело обрушиваются невзгоды, поэтому благородные эльфы все чаще взывают к диким кентаврам с целью объединить силы против общего врага (призыв Кентавра-копейщика).',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x010tg1026',
      text:
          'Демонологи охотно награждают клеймом Бетрезена даже крестьян, пожелавших ради мнимого спасения встать под знамена Легионов Проклятых (призыв Одержимого).',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x010tg1027',
      text:
          'Выброшенные на улицу собаки сбиваются в стаи, подобно волкам, и поедают заживо одиноких путников, чтобы не умереть с голоду (призыв Псины).',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x010tg1028',
      text:
          'К чему только ни прибегнут оборванцы, чтобы попытать счастье и отнять деньги у праздно шатающихся толстосумов (призыв Разбойника).',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x010tg1029',
      text:
          'В тяжелое время правящие лорды имперских городов призывают на военную службу даже фермеров и бедняков (призыв Ополченцев на все поле боя).',
      verified: null,
      context: "",
    ));
    objects.add(Tglobal(
      txt_id: 'x010tg1030',
      text:
